    [Fact]
    public void UserChallengeService_SearchFirstName_InValid()
    {
      //Arrange

      var optionsBuilder = new DbContextOptionsBuilder<ApplicationDbContext>();

      optionsBuilder.UseInMemoryDatabase("UserChallengeApp1");
      var _dbContext = new ApplicationDbContext(optionsBuilder.Options);

      var options = new Mock<IOptions<AppSettings>>();
      var appSetting = new AppSettings
      {
        //Not mcuh App Settings for now
      };
      options.Setup(_ => _.Value).Returns(appSetting);

      // Insert seed data into the database using one instance of the context
      using (var context = _dbContext)
      {
        context.users.Add(GetMockUser());
        context.SaveChanges();

        var service = new UserService(_dbContext, options.Object);
        var result = service.SearchUserByFirstName("None");
        Assert.Null(result);
      }

    }

